gS(3,"Permanent crop & watercress copying","You unlocked your first permanent type of plant.","You unlocked your first permanent type of plant. Plants like this don't wither, keep producing forever, and have much more powerful production upgrades too.<br><br>Watercress also remains useful: if you plant a watercress next to permanent plants, it copies all its orthogonal neighbors' production, no matter how high level it is. However there's a penalty to copying for having many watercress, so max 1 or 2 makes sense.<br><br>TIP: See shortcuts in the main help menu for various shortcuts that make planting easier (\"p\" or shift+click to plant last crop, ctrl+click to plant watercress, ...).",
void 0,"<br><br>The image below shows an optimal configuration to use for watercress copying: it duplicates the production of 4 blackberries:",[[void 0,ye[4],void 0],[ye[4],Ef[4],ye[4]],[void 0,ye[4],void 0]]);
gS(19,"Mushrooms","You unlocked your first type of mushroom","You unlocked your first type of mushroom. Mushrooms produce spores, but they consume seeds from orthogonally touching berries. If the berry cannot produce enough seeds for the mushroom, the mushroom produces less spores.<br><br>Spores let the tree level up (but mushrooms don't have to touch the tree), unlocking next kinds of bonuses.<br><br>The mushroom can (and should!) be boosted by flowers. This boosts its production, but also increases its seed consumption.<br><br>Leave some berries without mushrooms too, otherwise you won't get enough seed production for next upgrades and crops.",void 0,
"<br><br>The image shows a possible configuration for mushrooms: it extracts seeds from the berry it touches. In addition, both the mushroom and berry are boosted by flowers. In addition, there's another berry that doesn't touch a mushroom so that there's some global seed production too.",[[Ze[4],ze[4],void 0],[Re[4],Re[4],void 0],[ze[4],Re[4],void 0]]);
gS(20,"Flowers","You unlocked your first type of flower","You unlocked your first type of flower. Flowers boost resource-producing crops such as berries and mushrooms, if planted next to them. It can boost all the 4 orthogonal neighboring crops.",void 0,"<br><br>The image shows a possible good configuration for flower boost: multiple flowers boost multiple berries. The center-most blackberry is receiving the boost 4 times.",[[ye[4],Re[4],ye[4]],[Re[4],ye[4],Re[4]],[ye[4],Re[4],ye[4]]]);
gS(21,"Nettles","Unlocked a new crop: nettle. Nettle boosts mushrooms it touches orthogonally, but hurts flowers and berries.","Unlocked a new crop: nettle. Nettle boosts mushrooms it touches orthogonally, but hurts flowers and berries. The mushroom boost increases spore production without increasing seeds consumption. The boost is an additional multiplier independent from flower boost to mushroom, so having both a nettle and a flower works even better.",zf[4],"<br><br>The image shows a possible configuration where the mushroom receives boost from both nettle (top) and flower (bottom). The top left flower and top right blackberry in this image however are negatively affected by the nettle.",
[[Re[4],zf[4],ye[4]],[ze[4],Ze[4],ze[4]],[Se[4],Se[4],Se[4]]]);gS(6,"Tree leveled up","Tree leveled up","Thanks to spores, the tree completely rejuvenated and is now a "+Ri[Gy(1)][0]+", level 1. More spores will level up the tree more. The tree can unlock abilities and more at higher levels. Click the tree in the field for more info.",void 0,void 0,[[void 0,Ri[Gy(1)][1][0]],[void 0,Ri[Gy(1)][2][0]]]);
